css:
atom-workspace {
  background: radial-gradient(#ffff00, #008000, #0000ff) no-repeat center center #777777;
  background-size: cover;
}
atom-workspace status-bar.status-bar {
  background-color: rgba(0, 0, 0, 0.55);
}
.line {
  background-color: rgba(0, 0, 0, 0.4);
}
.lines > div:first-child > div {
  background-color: transparent !important;
}
.btn,
.btn.btn-default {
  background-color: transparent;
  background-image: linear-gradient(rgba(38, 38, 38, 0.55), rgba(51, 51, 51, 0.55));
}
.btn:hover,
.btn.btn-default:hover {
  background-color: transparent;
  background-image: linear-gradient(rgba(77, 77, 77, 0.55), rgba(102, 102, 102, 0.55));
}
.settings-view select.form-control {
  background-color: rgba(38, 38, 38, 0.55);
}
.settings-view select.form-control:hover {
  background-color: rgba(77, 77, 77, 0.55);
}
.settings-view select.form-control option {
  background-color: rgba(13, 13, 13, 0.55);
}
.settings-view .package-detail .package-card,
.settings-view .package-card {
  background-color: rgba(38, 38, 38, 0.55);
}
.settings-view .package-detail .package-card:hover,
.settings-view .package-card:hover {
  background-color: rgba(77, 77, 77, 0.55);
}
.settings-view .config-menu .nav > li.active > a {
  background-color: rgba(26, 26, 26, 0.55);
}
.settings-view .config-menu .nav > li.active > a:hover {
  background-color: rgba(77, 77, 77, 0.55);
}
.settings-view .config-menu .nav > li > a:hover {
  background-color: rgba(0, 0, 0, 0.55);
}
atom-panel .am-panel {
  background-color: rgba(0, 0, 0, 0.85);
}
atom-panel .am-panel .panel-heading {
  background-color: rgba(38, 38, 38, 0.35);
}
.tree-view .selected::before,
.tree-view-resizer {
  background-color: rgba(0, 0, 0, 0.55);
}
.tab-bar,
.tree-view,
atom-panel {
  background-color: rgba(0, 0, 0, 0.55) !important;
}
.tab-bar .tab .title,
.tree-view .tab .title,
atom-panel .tab .title {
  background-color: rgba(0, 0, 0, 0.55) !important;
}
.tab-bar .tab::after,
.tree-view .tab::after,
atom-panel .tab::after {
  background-image: none;
}
.close-icon {
  color: #fff;
  text-shadow: 0 0 20px black;
}
atom-panel.modal::before {
  background-color: rgba(0, 0, 0, 0.55) !important;
}
atom-panel.modal .list-group {
  max-height: 90vh;
  background-color: transparent !important;
}
.settings-view,
.config-menu,
.settings-view .panels,
.settings-panel {
  background-color: rgba(0, 0, 0, 0.55) !important;
}
background-tips .message {
  color: white;
  text-shadow: 0 0 9px black;
}
atom-text-editor,
:host {
  background-color: rgba(0, 0, 0, 0.55);
  color: #c5c8c6;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #282a2e;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #373b41;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #373b41;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: rgba(0, 0, 0, 0.4);
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: rgba(255, 255, 255, 0.2);
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #969896;
}
atom-text-editor .invisible,
:host .invisible {
  color: #c5c8c6;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: rgba(127, 127, 127, 0.6);
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #969896;
}
.entity.name.type {
  color: #f0c674;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #b5bd68;
}
.keyword {
  color: #b294bb;
}
.keyword.control {
  color: #b294bb;
}
.keyword.operator {
  color: #c5c8c6;
}
.keyword.other.special-method {
  color: #81a2be;
}
.keyword.other.unit {
  color: #de935f;
}
.storage {
  color: #b294bb;
}
.constant {
  color: #de935f;
}
.constant.character.escape {
  color: #8abeb7;
}
.constant.numeric {
  color: #de935f;
}
.constant.other.color {
  color: #8abeb7;
}
.constant.other.symbol {
  color: #b5bd68;
}
.variable {
  color: #cc6666;
}
.variable.interpolation {
  color: #bf4040;
}
.variable.parameter.function {
  color: #c5c8c6;
}
.invalid.illegal {
  background-color: #cc6666;
  color: rgba(0, 0, 0, 0.55);
}
.string {
  color: #b5bd68;
}
.string.regexp {
  color: #8abeb7;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #cc6666;
}
.punctuation.definition.comment {
  color: #969896;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #c5c8c6;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #81a2be;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #bf4040;
}
.support.class {
  color: #f0c674;
}
.support.function {
  color: #8abeb7;
}
.support.function.any-method {
  color: #81a2be;
}
.entity.name.function {
  color: #81a2be;
}
.entity.name.class,
.entity.name.type.class {
  color: #f0c674;
}
.entity.name.section {
  color: #81a2be;
}
.entity.name.tag {
  color: #cc6666;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #de935f;
}
.entity.other.attribute-name.id {
  color: #81a2be;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #81a2be;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #373b41;
  color: #c5c8c6;
}
.none {
  color: #c5c8c6;
}
.markup.bold {
  color: #de935f;
  font-weight: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #b5bd68;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #b5bd68;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b5bd68;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
